import React, { useEffect, useState } from 'react';
import HeroSection from '../../components/landingpage/HeroSection.js';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';
// import "./../../css/landingPage.css";

const LandingPage = () => {
  const [headerColor, setHeaderColor] = useState('#00183d'); // Default header color
  const [isMenuOpen, setIsMenuOpen] = useState(false); // State to handle mobile menu toggle

  const handleScroll = () => {
    const scrollTop = window.scrollY;
    if (scrollTop > 50) {
      setHeaderColor('#002d55'); // Dark blue color when scrolled down
    } else {
      setHeaderColor('#00183d'); // Original color when at the top
    }
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div>
      <header style={{ 
        position: 'fixed', 
        top: 0, 
        left: 0, 
        right: 0, 
        backgroundColor: headerColor, 
        zIndex: 1000, 
        padding: '10px 20px', // Reduced padding for mobile
        height: '80px', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between' 
      }}>
        <img src={require('./../../assets/logo.png')} alt="Logo" style={{ height: '50px' }} />
        <button 
          style={{ background: 'none', border: 'none', color: 'white', fontSize: '24px', cursor: 'pointer' }} 
          onClick={() => setIsMenuOpen(!isMenuOpen)}
        >
          â˜°
        </button>
        <nav style={{ display: isMenuOpen ? 'block' : 'none', position: 'absolute', top: '80px', right: 0, backgroundColor: headerColor, width: '100%' }}>
          <ul style={{ display: 'flex', flexDirection: 'column', listStyleType: 'none', margin: 0, padding: 0 }}>
            <li style={{ margin: '10px 0', textAlign: 'center' }}>
              <a 
                href="#about-us" 
                onClick={(e) => { e.preventDefault(); scrollToSection('about-us'); }} 
                style={{ 
                  color: 'white', 
                  textDecoration: 'none', 
                  fontWeight: 'bold', 
                  fontSize: '18px', 
                  transition: 'color 0.3s', 
                }}
                onMouseEnter={(e) => e.currentTarget.style.color = '#FFD700'}
                onMouseLeave={(e) => e.currentTarget.style.color = 'white'}
              >
                About Us
              </a>
            </li>
            <li style={{ margin: '10px 0', textAlign: 'center' }}>
              <a 
                href="#services" 
                onClick={(e) => { e.preventDefault(); scrollToSection('services'); }} 
                style={{ 
                  color: 'white', 
                  textDecoration: 'none', 
                  fontWeight: 'bold', 
                  fontSize: '18px', 
                  transition: 'color 0.3s', 
                }}
                onMouseEnter={(e) => e.currentTarget.style.color = '#FFD700'}
                onMouseLeave={(e) => e.currentTarget.style.color = 'white'}
              >
                Services
              </a>
            </li>
            <li style={{ margin: '10px 0', textAlign: 'center' }}>
              <a 
                href="#portfolio" 
                onClick={(e) => { e.preventDefault(); scrollToSection('portfolio'); }} 
                style={{ 
                  color: 'white', 
                  textDecoration: 'none', 
                  fontWeight: 'bold', 
                  fontSize: '18px', 
                  transition: 'color 0.3s', 
                }}
                onMouseEnter={(e) => e.currentTarget.style.color = '#FFD700'}
                onMouseLeave={(e) => e.currentTarget.style.color = 'white'}
              >
                Portfolio
              </a>
            </li>
          </ul>
        </nav>
      </header>

      <div style={{ paddingTop: '100px' }}> {/* Adjusted padding to prevent content from hiding behind the header */}
        <HeroSection />

        <div id="about-us">
          <AboutUs />
        </div>
        <div id="services">
          <Services />
        </div>
        <div id="portfolio">
          <Portfolio />
        </div>

        <Testimonials />
        <ContactUs />
        <FAQ />
      </div>
    </div>
  );
};

export default LandingPage;
